import React from 'react';
import './SearchResults.css';

export const SearchResults = ({ results, isLoading, selectedItem, onItemSelect }) => {
  if (isLoading) {
    return (
      <div className="loading-results">
        <div className="loading-spinner"></div>
        <span>Searching MBS items...</span>
      </div>
    );
  }

  if (!results || results.length === 0) {
    return (
      <div className="no-results">
        <div className="no-results-icon">
          <svg xmlns="http://www.w3.org/2000/svg" width="48" height="48" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
            <circle cx="12" cy="12" r="10"></circle>
            <line x1="8" y1="12" x2="16" y2="12"></line>
          </svg>
        </div>
        <h3 className="no-results-text">No results found</h3>
        <p className="no-results-subtext">Try adjusting your search or filters</p>
      </div>
    );
  }

  const formatCurrency = (value) => {
    if (!value && value !== 0) return 'N/A';
    return `$${parseFloat(value).toFixed(2)}`;
  };

  return (
    <div className="search-results">
      <div className="results-list">
        {results.map((item) => (
          <div 
            key={item.id || item.ItemNum}
            className={`result-item ${selectedItem && (selectedItem.id === item.id || selectedItem.ItemNum === item.ItemNum) ? 'selected' : ''}`}
            onClick={() => onItemSelect(item)}
          >
            <h3 className="result-title">
              Item {item.ItemNum} - {item.CategoryDescription || 'Uncategorized'}
            </h3>

            <div className="result-meta">
              <div className="meta-item">
                <svg xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                  <path d="M12 2L2 7l10 5 10-5-10-5z"></path>
                  <path d="M2 17l10 5 10-5"></path>
                  <path d="M2 12l10 5 10-5"></path>
                </svg>
                <span>{item.GroupDescription || 'No Group'}</span>
              </div>

              <div className="meta-item">
                <svg xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                  <circle cx="12" cy="12" r="10"></circle>
                  <line x1="12" y1="8" x2="12" y2="12"></line>
                  <line x1="12" y1="16" x2="12.01" y2="16"></line>
                </svg>
                <span>Type: {item.ItemType || 'Standard'}</span>
              </div>

              <div className="meta-item">
                <svg xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                  <line x1="12" y1="1" x2="12" y2="23"></line>
                  <path d="M17 5H9.5a3.5 3.5 0 0 0 0 7h5a3.5 3.5 0 0 1 0 7H6"></path>
                </svg>
                <span>Fee: {formatCurrency(item.ScheduleFee)}</span>
              </div>
            </div>

            <p className="result-description">
              {item.HumanReadableDescription || item.Description || 'No description available'}
            </p>

            {item.IsSpecialistItem && (
              <div className="result-tags">
                <span className="result-tag">Specialist</span>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};
